import React from 'react'
import { NavLink, Route, useLocation } from 'react-router-dom';
import {
    Typography, Button, Grid, Checkbox, TextField, OutlinedInput,
    FormControl, InputLabel, InputAdornment, IconButton
} from "@material-ui/core"
import SharpIcon from '@material-ui/icons/SendSharp';
import { makeStyles } from '@material-ui/core/styles';


import '../CSS/Register.scss';

// import Login from './Login';
import SignUp from './SignUp';

const Style = makeStyles({
    btn: {
        width: "100%",
        background: "red",
        height: "3rem",
        color: "#fff",
        "&:hover": {
            color: "red"
        }
    },
    logbtn: {
        color: "yellow", 
        fontWeight: "bolder", 
        margin: "0 5px",
        "&:hover":{
            color: "black"
        }
    }
})

const Register = () => {
    const classes = Style();

    return (
        <>
            <div className="register_container">
                <div className="login_btn_container">
                    <Button
                        variant="contained"
                        type="submit"
                        endIcon={<SharpIcon />}
                        className={classes.btn}
                    >
                        Already Have an Account <span className={classes.logbtn}> Login</span>
                    </Button>
                </div>
                <div className="signup">
                    <SignUp />

                </div>



            </div>
        </>
    )
}

export default Register;
